import React from 'react';
import { Container } from './style';

const InputSelect: React.FC = () => {
    return (
        <Container>
            <select name="" id="">
                <option value="">a</option>
                <option value="">b</option>
                <option value="">c</option>
            </select>
        </Container>
    );
}

export default InputSelect;
